(function () {
  ymaps.ready(init);

  function init() {
    var myMap = new ymaps.Map('map', {
      center: [59.93963569, 30.31468791],
      zoom: 10,
      controls: []
    });
    var coords = [['59.957402', '30.297164'], ['59.938989', '30.348039'], ['59.936010', '30.270080']];
    var myCollection = new ymaps.GeoObjectCollection({}, {
      draggable: false,
      iconLayout: 'default#image',
      iconImageHref: 'img/marker.svg',
      iconImageSize: [76, 95],
      iconImageOffset: [-3, -42]
    });
    coords.forEach(function (coord) {
      myCollection.add(new ymaps.Placemark(coord));
    });
    myMap.geoObjects.add(myCollection);
  }
})();

(function () {
  var menuBtn = Array.from(document.querySelectorAll('section.menu .menu__item'));
  var menuFullElems = Array.from(document.querySelectorAll('section.menu .menu__full'));
  var menuCloseBtns = Array.from(document.querySelectorAll('section.menu .close-menu-full'));

  var addHiddenClass = function addHiddenClass(el) {
    el.classList.add('menu__full-hidden');
  };

  var removeHiddenClass = function removeHiddenClass(el) {
    el.classList.remove('menu__full-hidden');
  };

  menuBtn.forEach(function (btn, i) {
    btn.addEventListener('click', function () {
      if (!menuFullElems[i].classList.contains('menu__full-hidden')) {
        addHiddenClass(menuFullElems[i]);
        return;
      }

      menuFullElems.forEach(function (div) {
        return addHiddenClass(div);
      });
      removeHiddenClass(menuFullElems[i]);
    });
  });
  menuCloseBtns.forEach(function (btn, i) {
    btn.addEventListener('click', function () {
      addHiddenClass(menuFullElems[i]);
    });
  });
})();

